<template>
  <div class="QRcode">
    <a href="http://localhost:8080/first"><h2>西安客运票务网</h2></a>
    <div class="row"></div>
    <div id="divPay">
      <div class="payinfowx">
        <p>
          支付金额
          <span class="price" v-for="(item, index) in 1" :key="index">
            {{ list.master_total_amount }}
          </span>
          <label id="tipMsg">请扫描下方二维码完成支付</label>
        </p>
        <div class="qrCode">
          <!-- <img :src="imgUrl" alt=""/> -->
          <img
            src="data:image/png;base64,"
            alt=""
          />
        </div>
      </div>
    </div>
  </div>
</template>
<script>
export default {
  name: 'QRcode',
  data() {
    return {
      list: {},
    }
  },
  created() {
    this.info()
    this.loop()
  },
  mounted: function () {
    this.getimg()
  },
  computed: {
    myObj: {
      get: function () {
        return this.list // 在这里把临时对象的值通过计算属性赋值给页面中用到的对象
      },
    },
  },
  methods: {
    //轮询判断
    loop() {
      //使用setInterval不会清除定时器队列，每重复执行1次都会导致定时器叠加，最终卡死你的网页。但是setTimeout是自带清除定时器的
      const timer = setInterval(() => {
        setTimeout(function () {
          this.$http
            .get(
              '/order/payOrderVerify?master_order_number=' +
                window.sessionStorage.getItem('master_order_number')
            )
            .then(function (res) {
              console.log(res)
            })
        })
      }, 1000)
      //hook同一个组件不想在写一个beforeDestory函数，父组件监听子组件@hook:mounted="函数名"
      this.$once('hook:beforeDestory', () => {
        clearInterval(timer)
        timer = null
      })
    },
    //得到二维码
    getimg() {
      this.$http
        .get(
          '/order/payOrder?master_order_number=' +
            window.sessionStorage.getItem('master_order_number'),
          {
            responseType: 'arraybuffer',
          }
        )
        .then((res) => {
          console.log(window.sessionStorage.getItem('master_order_number'))
          console.log(res)
          console.log(
            window.btoa(
              new Uint8Array(res.data).reduce(
                (data, byte) => data + String.fromCharCode(byte),
                ''
              )
            ),
            'base64'
          )
        })
    },
    //拿到钱数
    info() {
      var getlocaldata = sessionStorage.getItem('localdata')
      var jsonobj = JSON.parse(getlocaldata)
      this.list = jsonobj
    },
  },
}
</script>
